import './MetricCard.css'

export function MetricCard(props) {
    const {title, color, value, png} = props;

    return (
        <>
            <div className="parentContainer">
                <div className="CompactCard">
                    {png}
                    <div className="iconDisplay">
                        {png}
                        {title}
                    </div>
                    <div className="detail">
                        {value}
                    </div>
                </div>
            </div>
        </>

    )

}
